function browseMethod(methodName) {
    if (!methodName || !this.targetClass) return;

    this.targetMethodName = methodName;

    var klass = this.targetClass;
    var methodName = methodName;

    var source = "this." + klass.type + ".addMethods({\n" + methodName + ": " +
        klass.prototype[methodName].getOriginal() + "\n});"
    this.get('sourceText').setTextString(source)

    this.showMethodPath();
}

