function classSourceOf(klass) {
    var classSource = '';
    var superClass = klass.superclass;

    if (superClass.isPrivateClass) {
        classSource = 'this.declarePrivateClass(this.'+(superClass.type || superClass.name)+', "'+(this.targetClass.type || this.targetClass.name)+'"';//, {';
    } else {
        classSource = 'this.declarePrivateClass('+(superClass.type || superClass.name)+', "'+(this.targetClass.type || this.targetClass.name) + '"';//+'", {';
    }

    /*
    var hasOneProperty = false;
    for (methodName in klass.prototype) {
        if (methodName == "constructor" || !klass.prototype.hasOwnProperty(methodName)) {
            continue;
        }

        if (!hasOneProperty) {
            hasOneProperty = true;
            classSource += "\n";
        }

        classSource += methodName + ': ' + klass.prototype[methodName].toString() + ",\n";
    }*/

    classSource += ');'//'});';

    return classSource;
}

