function updateClassList() {
    var list = [];
    var classes = this.morph.getPrivateClasses();
    for (var i=0;i<classes.length; ++i) {
        var className = classes[i];
        list.push({ isListItem: true, value: className, string: className });
    }

    this.get('classesList').updateList(list);
}

