function updateFor(result) {
    this.updateClassList();

    if (result && result.isPrivateClass) {
        this.targetClassName = result.type;
        this.get('classesList').setSelection(this.targetClassName);
    }

    this.get('categoriesList').setSelection(this.targetCategoryName);
    this.get('methodsList').setSelection(this.targetMethodName);
}

